@use "abstracts" as *;

.cb-c-button {
  outline: none;
  border: none;
  background-color: $secondary-color;
  padding: 0.5rem 1rem;
  color: $neutral-white;
  border-radius: 4px;
  text-decoration: none;
  cursor: pointer;

  &--secondary {
    @extend .cb-c-button;
    color: black;
    background-color: $accent-color;
  }

  &--large {
    @extend .cb-c-button;
    padding: 0.7rem 1.5rem;
    font-weight: bolder;
    border-radius: 8px;
  }
}

